import React from 'react'
import './feature.css'
const Feature = ({title, text}) => {
  return (
    <div className='gpt3__features-container__feature'> 
    <div className='gpt3__features-container__feature-'>
      <div></div>
      <h1>{title}</h1>
    </div>
    <div className='gpt3__features-container__features-text'>
      {text}
    </div>
    </div>
  )
}

export default Feature
